import axios from 'axios'

class UserService{

    signup_service(data){
        return axios.post(baseUser+"signupjwt/",data)
    }


    login_service(data){
        return axios.post(baseUser+"user_login/", data)
    }

    forgotPassword_service(data){
        return axios.post(baseUser+"forgot_password/",data)
    }



}
export default UserService;
